import React from "react";
import { NavLink } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return (
    <>
      <nav class="navbar">
        <div class="nav-container">
          <NavLink exact to="/" class="nav-logo" >AD</NavLink>
        
            <ul>
                <li>
                    <NavLink exact to = "/" class="nav-links">Intro</NavLink>
                
                    <li>
                    <NavLink exact to = "/" class="nav-links">Portfolio</NavLink>
                </li>
                <li>
                    <NavLink exact to = "/" class="nav-links">Projects</NavLink>
                </li></li>
                <li>
                    <NavLink exact to = "/" class="nav-links">Home</NavLink>
                </li>
            </ul>

        </div>
      </nav>
    </>
  );
};

export default Navbar;
